import React from 'react';
import PropTypes from 'prop-types';

function ProviderHeader({ children }) {
  return (
    <div>
      {children}
    </div>
  );
}

ProviderHeader.propTypes = {
  children: PropTypes.node,
}.isRequired;

export default ProviderHeader;
